import './src/Home.css';
import Card from './src/Card/Card';
import Summary from './src/Summary/Summary';
import CloudCards from './src/CloudCards/CloudCards';
import Buttons from './src/Buttons/Buttons';
import ButtonOne from './src/ButtonOne/ButtonOne';
import {Route} from 'react-router-dom';



class Home extends Component {
  render(){
    const style = {
      padding: '20px'
    }

  return (

    <div className="App">

    <header>
      <nav>
        <ul className = "menu">
          <li className = 'mainmenu'><a className = 'menufont' href = "https://www.google.com">Home</a></li>
          <li className = 'mainmenu'><a className = 'menufont' href = "/">Blog</a></li>
          <li className = 'mainmenu'><a className = 'menufont' href = "/">About</a></li>
          <li className = 'mainmenu'><a className = 'menufont' href = "/">Contact</a></li>
        </ul>
      </nav>
    </header>

    <h1>Test</h1>

    <br/>
    <br/>
<ButtonOne/>

<nav className = 'cent'>

</nav>

<Route path = "/" render={() => <h1>Home</h1>}/>
    </div>




  );

}
}

export default Home;
